import React, { Component } from 'react'

class BoxChildren extends Component {
  render() {
    return (
      <div style={{border: '1px solid #000', marginTop: 10, padding: 10}}>
        {this.props.children}
      </div>
    )
  }
}

class App extends Component {

  render () {
    return (
      <div className="App">
        <h2>Children</h2>
        <BoxChildren>
          Soy children!
        </BoxChildren>
        <BoxChildren>
          Hola, soy el otro Children
        </BoxChildren>
      </div>
    );
  }
}

export default App;
